import React from 'react';
import './task2.css';
class Task2 extends React.Component{
    constructor(){
        super()
        this.state={message:''}
    } 
    change(){
        this.setState({message:"Hello"})
    }
    
    render(){
        return(
            <div onClick={()=>this.change()}>
                <button className="button1">Item1<h1>{this.state.message}</h1></button>
                <button>Item2</button>
                <button>Item3</button>
                <button>Item4</button>
            </div>
        )
    }
}
export default Task2;
